import React, { useState } from "react";
import { Input } from "./ui/input";
import { Button } from "./ui/button";
import { Label } from "./ui/label";
import { Eye, EyeOff, LogIn } from "lucide-react";

export default function Login() {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [showPassword, setShowPassword] = useState(false);

  const handleSubmit = (e) => {
    e.preventDefault();
    // Apenas frontend, não faz nada
  };

  return (
    <div className="flex min-h-screen items-center justify-center bg-[#e8f5e9]">
      <div className="max-w-md w-full mx-auto space-y-7 bg-white shadow-md rounded-lg p-8">
        <div className="flex flex-col items-center mb-2">
          <LogIn size={36} className="text-green-600 mb-2" />
          <h2 className="text-2xl font-semibold text-green-700 mb-2">Login</h2>
          <p className="text-gray-500 text-center text-sm">
            Acesse sua conta para usar o Cardio Check.
          </p>
        </div>
        <form className="space-y-4" onSubmit={handleSubmit}>
          <div>
            <Label htmlFor="email">E-mail</Label>
            <Input
              id="email"
              type="email"
              autoComplete="username"
              className="w-full"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              placeholder="seu@email.com"
              required
            />
          </div>
          <div>
            <Label htmlFor="password">Senha</Label>
            <div className="relative">
              <Input
                id="password"
                type={showPassword ? "text" : "password"}
                autoComplete="current-password"
                className="w-full pr-10"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
                placeholder="Digite sua senha"
                required
              />
              <button
                type="button"
                onClick={() => setShowPassword((s) => !s)}
                tabIndex={-1}
                className="absolute right-3 top-1/2 -translate-y-1/2"
                aria-label={showPassword ? "Ocultar senha" : "Mostrar senha"}
              >
                {showPassword ? (
                  <EyeOff className="h-5 w-5 text-gray-500" />
                ) : (
                  <Eye className="h-5 w-5 text-gray-500" />
                )}
              </button>
            </div>
          </div>
          <Button
            type="submit"
            className="w-full bg-green-600 text-white hover:bg-green-700"
          >
            Entrar
          </Button>
        </form>
      </div>
    </div>
  );
}
